import Style from "./Forms.module.css"

export default function Forms(props) {

    return (
        <form className={Style.form}>
                <div className={Style.input}>
                    <label>Amount</label>
                    <input type="number"></input>
                </div>
                <button type="submit">+ Add</button>
        </form>
    );
}
